;(function(){
    function Xui() {
        this.appVersion = '0.0.0';
        this.deviceId = 'developer';
        this.systemType = 'web';
        this.params = {
            ajax: {
                url: '',
                method: 'post',
                timeout: 60 * 20,
                dataType: 'json',
                data: {}
            }
        };
    }

    Xui.prototype = {
        pageParam: (function(){
            var pageParam = {};
            var query = window.location.search.substr(1);
            var params = query.split('&');
            _.each(params, function(param){
                var key = param.split('=')[0];
                var value = param.split('=')[1];
                pageParam[key] = value;
            });
            console.log(pageParam);
            return pageParam;
        })(),
        closeWin: function() {
            location.href = document.referrer;
        },
        require: function() {},
        ajax: function(params, callback) {
            var ret,
                err;
            params = _.extend({}, this.params.ajax, params);
            if (!callback || typeof callback !== 'function') {
                console.log('callbackcallback');
                return;
            }
            if (!params.url) {
                console.log('url');
                return;
            }
            // params.data.values.data = _g.j2s(params.data.values.data);
            $.ajax({
                type: params.method,
                url: params.url,
                data: params.data.values,
                cache: false,
                dataType: params.dataType,
                success: function(result) {
                    ret = result;
                    callback(ret, err);
                },
                error: function(result) {
                    err = result;
                    callback(ret, err);
                }
            });
        },
        showProgress: function() {},
        hideProgress: function() {},
        confirm: function() {},
        setRefreshHeaderInfo: function() {},
        refreshHeaderLoadDone: function() {},
        removeLaunchView: function() {},
        toast: function(opts) { console.log(opts) },
        openWin: function(params) {
            if(params.url == '../baseWin/index.html'){
                // _g.openWin
                var url = params.pageParam.opts.url;
                var pageParam = params.pageParam.opts.pageParam;

            }else {
                // api.openWin
                var url = params.url;
                var pageParam = params.pageParam;
            }
            var queryList = [];
            var query = '?';
            var hasQuery = (url.split('?').length == 2);
            if(hasQuery){
                queryList.push(url.split('?')[1]);
            }
            url = url.split('?')[0];
            _.each(pageParam, function(value, key){
                queryList.push(key + '=' + value);
            });
            query += queryList.join('&');
            window.location.href = url + query;
        },
    };

    Xui.prototype.constructor = Xui;

    window.Xui = new Xui();
})();
